@olegz  I made this change for the issue mentioned here 
https://github.com/spring-cloud/spring-cloud-function/issues/844
Please let me know if this doesn't clarify I will create a test and update it here.

@atyamlalithya I think i understand. That is because we're treating your custom Object as POJO, thus mapping it only to a payload/body. 
Can you please change your function to use Spring Message `org.springframework.messaging.Message`. It only has two fields, `getPayoad()` and `getHeaders()`.
```
public class MyFunction
    implements Function<Message, String> {
    @Override
    public String apply(Message input) {
    }
}
``` 
I am not saying this is a final solution (need to think), but I just wanted you to try as well as provide an acceptable workaround.

Let me know

